import React from 'react'
// import 'Ourwork.css'
import "../ourwork/Ourwork.css"
import Ourworkmenu from './Ourworkmenu'
function Ourwork() {
  return (
    <div class="container">
    <h1>Our Work</h1>
    <div data-filter="*" class="cbp-filter-item cbp-filter-item-active">
             <span>All Works</span>
          </div>
  </div>
  )
}

export default Ourwork
